import {Button} from '@mui/material';
import React from 'react';
import "./Item.css";
import { Link } from 'react-router-dom';
const Item = (props) => {
    const { _id,name,author,description,price,image} = props.item;
     
     
     return (
     <div className = "card" >
         <img src={image} alt={name} />
         <article>By {author} </article>
         <h3> {name} </h3>
          <p>{description} </p>
          <h3>Rs{price} </h3>
          <Button LinkComponent={Link} to={'/items/${_id}'} sx={{ mt: "auto"}} >
            Update
            </Button>
          <Button sx={{ mt: "auto"}} >Delete</Button>
    </div>
  );
};

export default Item;
